After completion of the course, the students will:

1. demonstrate a broad knowledge and deep understanding of the fundamental debates in sociology and, more broadly, social sciences;
2. be familiar with some of the most important sociological theories developed in the 19-20th centuries and know how to put the theories of authors like Marx, Durkheim, Weber, and Goffman in social and historical perspective;
3. have learned the skills of accessing the pros and cons of intellectual currents such as positivism, Marxism, symbolic interactionism, feminism, Goffman on the presentation of self in everyday life;
4. apply sociological theories to analyze contemporary social issues and controversies as well as students personal experiences;
5. learn to mobilize their personal experiences and backgrounds as resources for engaging with sociologys foundational theory and research.

1) The student is able to describe the main clinical and histopathological manifestations as well as therapeutic options of the disease discussed in the course;



2) The student is able to investigate histopathological, clinical and imaging abnormalities to reach diagnosis, prognosis, and the therapeutic options for the neurological diseases discussed in the course;



3) The student is able to describe a clinical case and critically discuss the main symptoms based on the latest literature;



4) The student is able to combine histopathological, neuroimaging, and clinical knowledge on neurological conditions in order to identify new directions for future research;



5) The student is able to explain why societal impact and public outreach is important in the field of clinical neuroscience and will know how to explain topics related to clinical neuroscience to laymen.

The student is able to:

form and defend a science-based opinion of the importance of biodiversity and the threats posed by its loss;
critically assess the various causes of biodiversity loss and its possible consequences;
identify which ecological, population biological and genetic processes play a role in the extinction of populations and species;
critically assess the aplication of scientific theory and knowledge in conservation and restoration
critically assess whether and how urban areas play a role in biodiversity conservation;
critically assess the suitability of strategiesand targets that are applied in conservation and restoration;
explain the challenges facing the practice of conservation and ecological restoration.

By the end of this course, students will be able to:





 Identify major human rights instruments and theories;



 Explain the role of human rights in our understanding of concepts such as sovereignty and liberal democracies;



 Discuss the contribution that specific human rights case studies can make to our understanding of human rights theory;



 Understand the different ways in which human rights are promoted by international organizations such as the United Nations, transnational advocacy networks, national actors, and individuals;



 Identify emerging issues in human rights, especially in the areas of youth activism, poverty, and humanitarian intervention.

After successfully completing the course, the student is able to:
1. describe the main themes in research pertaining to early human evolution;
2. identify knowledge gap and find primary sources that address this gap;
3. critically analyze scientific texts, including primary papers related to different aspects in early human evolution;
4. contrast and integrate various disciplinary perspectives;
5. critically reflect on the possibility of knowledge of past processes;

After successfully completing the course, the student:

has a deep knowledge base in the mode of action of the major endocrine factors, and their role in homeostasis and disease.
understands the broader context in which the human body regulate the level of a lot of chemicals by homeostasis and feedback mechanisms, and apply this knowledge to every-day situations.
develops cognitive, analytic and problem-solving skills through discussion and presentations of recent literature in the field of endocrinology and metabolism;
demonstrates the ability to assess which research methods are most suitable in a particular situation, in the form of a written MSc research proposal in the field of diabetes and obesity;
demonstrates excellent communication skills to express themselves well verbally and at an academic level in writing and present ideas in a clear effective way.

Upon completion of this course students will:

Possess a basic understanding of most aspects of the modern international economic order;
Understand link between the modern world system, globalization and capitalism form the 16th c. onwards;
Be familiar with the most important IPE theories;
Be familiar with research methods in the IPE field;
Be able to critically review and understand current developments in the global economic system;
Know how theoretical arguments are structured and tested empirically in IPE research;

