Students successfully completing this course:


 Will understand the historical contexts in which private law develops and its overall place in legal systems;

 Will have a broad comparative understanding of private law across different legal cultures;

 Will have knowledge of the various theories that explain, critique, or justify private law;

 Will understand the general features of contract law;

 Will have gained basic practical experience on how to present a private law argument;

 Will understand the general features of the law of torts;

 Will understand how private law can be used in pursuit of public goals;

 Will understand the general features of property law, including intellectual property law;

 Will acquire basic experience in reading judgments;

 Will understand the importance and general methodological dimensions of combining law and economics in a private law context;

 Will have gained understanding of the cultural and ideological dimensions of private law, including experiences and proposals in communist, post-communist, and libertarian perspectives.
